import React from "react";
import {SpinnerSVG} from "./SpinnerSVG";

const Loading = React.memo(() => (
  <div className="loader-container" data-testid="loading-component">
    <SpinnerSVG fill='#868e96'/>
  </div>
));
export default Loading;
